import React, { Component } from 'react'
import { MuiThemeProvider } from '@material-ui/core/styles';
import { createMuiTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core//Typography'
import red from '@material-ui/core/colors/red'
import List from '@material-ui/core/List'
import ListItem from '@material-ui/core/ListItem'
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';


const theme = createMuiTheme({
    palette: {
        primary: {
            main: red['A700']
        },
        secondary: {
            main: red[900]
        }
    }
});

export class Confirm extends Component {
    render() {
        const {values} = this.props;
        console.log(values)
        return (
            <MuiThemeProvider theme={theme}>
                <React.Fragment>
                    <AppBar position="static" color="primary" >
                        <Toolbar >
                            <Typography variant="h5">
                                WebMenu
                            </Typography>
                        </Toolbar>
                    </AppBar>
                    <List>
                        <ListItem
                            // primaryText="Nome de usuário"
                            // secondaryText={values.user}

                        >{values.user}</ListItem>
                        <ListItem
                            primaryText="Senha"
                            secondaryText={values.password}
                        />
                        <ListItem
                            primaryText="Email"
                            secondaryText={values.email}
                        />
                        <ListItem
                            primaryText="Estabelecimento"
                            secondaryText={values.placeName}
                        />
                        <ListItem
                            primaryText="Descrição do estabelecimento"
                            secondaryText={values.placeDescription}
                        />
                        <ListItem
                            primaryText="Telefone"
                            secondaryText={values.placePhone}
                        />
                    </List>

                </React.Fragment>
            </MuiThemeProvider>
        )
    }
}

export default Confirm
